import React from 'react';
import './Header.css';

export default function Header (){

    return(

        <div className='header'>

            <a href='/'>Logo</a>


            <a href="/myreservations">
                <button className='reservations-btn'>
                    My Reservations
                </button>
            </a>

            <a href="/login">
                <button className='reservations-btn'>
                    Logout
                </button>
            </a>

        </div>

    )
}
